import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { Box, AppBar, Toolbar, Container, Avatar, Typography, Menu, MenuItem } from '@mui/material';

const pages = ['Home', 'Menu', 'Reservation', 'Contact', 'My Account'];

const NavBar = () => {
  // State to manage the open/close state of the menu
  const [menuOpen, setMenuOpen] = useState(true);

  // Function to handle opening the menu
  const handleMenuOpen = () => {
    setMenuOpen(true);
  };

  // Function to handle closing the menu
  const handleMenuClose = () => {
    setMenuOpen(false);
  };

  return (
    <AppBar position="static" sx={{ backgroundColor: 'transparent'}}>
      <Container maxWidth="xl">
        <Toolbar>
          <Link to="/" style={{ textDecoration : 'none'}}>
            <Avatar 
                alt="Logo" 
                src={`logo.png`} 
                sx={{ width: '6rem', paddingTop: '1rem'}}
            />
            <Typography
              sx={{ 
                color: 'black',
                fontSize: '0.7rem',
                fontFamily: 'Knewave',
              }}
            >
              RELAXING KOALA
            </Typography>
          </Link>
          <Box>
            <Menu
              open={menuOpen} // Provide the open prop with the menuOpen state
              onClose={handleMenuClose} // Handler for closing the menu
              anchorOrigin={{ vertical: 'bottom', horizontal: 'center' }}
              transformOrigin={{ vertical: 'top', horizontal: 'center' }}
              getContentAnchorEl={null}
            >
              {pages.map((page) => (
                <MenuItem key={page} onClick={handleMenuClose}>
                  <div style={{ textAlign: 'center' }}>{page}</div>
                </MenuItem>
              ))}
            </Menu>
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
}

export default NavBar;
